import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  AccountCircleIcon
} from "@mui/material";

const Logincomponent2 = () => {
  return (
    <Box>
      <Card>
        <AccountCircleIcon />
      </Card>
    </Box>
  );
};

export default Logincomponent2;
